                        'rgba(255, 99, 132, 1)',
                        'rgba(54, 162, 235, 1)',
                        'rgba(255, 206, 86, 1)',
                        'rgba(75, 192, 192, 1)',
                        'rgba(153, 102, 255, 1)',
                        'rgba(255, 159, 64, 1)'
                    ],
                    borderWidth: 1,
                },
            ],

            }}
              height={400}
              width={600}
              options={{
                  maintainAspectRatio: false,
                  options
              }} 
              />          
        </div>
    )
}
export default CoinChart;
